INSERT INTO `question_content` VALUES (1,'question_001','camping','露营的时候可以带火炉取暖吗','游客在极目亭附近进行露营时可…','游客在极目亭附近进行露营时可以带火炉，但是在盆景园这种易燃区域是绝对不可以私人带火炉取暖的','2020-03-25','17:29:00',12,'huancui_Building'),(2,'question_002','cableway','可以在索道上带零食吗','游客是绝对不可以在进行索道…','游客是绝对不可以在进行索道游玩的过程中吃零食的，若零食不慎掉落可能会造成其他游客的人身安全问题','2020-03-25','18:29:00',14,'huancui_JiMuTing'),(3,'question_003','transfer','从环翠楼换乘多少号汽车可以到达盆景园','通常情况下游客可以直接通过…','通常情况下游客可以直接通过29号汽车直接中转到盆景园景点，到达盆景园景点之后请不要忘记保管好个人的随身物品','2020-03-25','19:29:00',16,'huancui_KongMiao'),(4,'question_004','ticket','一般来说门票会过期吗','有的游客可能会提前购买门票...','有的游客可能会提前购买门票，所以很多游客会担心我们景区的门票会不会过期，我们环翠区可以向广大游客承诺，我们的门票是不会过期的','2020-03-25','20:29:00',18,'huancui_PenJing'),(5,'question_005','safety','在景区遭受到小偷该怎么办','若游客在景区遇到了小偷，请...','若游客在景区遇到了小偷，请不要慌张，这个时候请冷静下来寻找我们的客户服务中心，我们将竭诚为您服务','2020-03-25','21:29:00',20,'huancui_Building'),(6,'question_006','monitor','景区的监控覆盖情况怎么样','我们的景区大型活动场所都会...','我们的景区大型活动场所都会有摄像头存在，所以游客不必担心个人的财产物品的安全问题','2020-03-25','22:29:00',22,'huancui_JiMuTing'),(7,'question_007','market','超市的物品太贵了该怎么办','如果游客遇到超市或商场价格...','如果游客遇到超市或商场价格虚高的情况，请直接与我们景区的工作人员相联系，我们将严格查办这些超市','2020-03-25','23:29:00',24,'huancui_KongMiao'),(8,'question_008','way','有的情况下手机导航无法使用无法导航怎么办','大部分游客都可以在景区内正常...','大部分游客都可以在景区内正常使用GPS定位，但是也会出现信号弱的情况，建议在这种情况下直接寻找路标，这样能够快速找到对应的景点','2020-03-25','00:29:00',26,'huancui_PenJing'),(9,'question_009','camping','露营最佳地点在哪里','极目亭是绝佳的露营地点，大约…','极目亭是绝佳的露营地点，大约有八成的游客都会在这里进行露营，晚上夜景很漂亮','2020-03-25','01:29:00',28,'huancui_Building'),(10,'question_010','cableway','小朋友可以上索道吗','根据国家规定，年龄小于12...','根据国家规定，年龄小于12周岁的未成年人需要有家长等亲属的陪同才能够在索道上欣赏美丽的风景','2020-03-25','02:29:00',30,'huancui_JiMuTing'),(11,'question_011','transfer','从环翠楼换乘多少号汽车可以到达极目亭','此区间内现在还没有开通...','此区间内现在还没有开通相关的换乘路线，推荐游客直接进行步行，因为路途非常短，大概三百米就可以到达','2020-03-25','03:29:00',32,'huancui_KongMiao'),(12,'question_012','ticket','门票是否可以转借','通过正规渠道购买的门票都是...','通过正规渠道购买的门票都是可以进行转借的，我们景区的门票在转借的过程中需要游客办理相关的身份更新业务，这样才能够转借成功','2020-03-25','04:29:00',34,'huancui_PenJing'),(13,'question_013','safety','如果不慎跌落景区该怎么办','如果游客在景区内不慎发生了…','如果游客在景区内不慎发生意外，这个时候请不要慌张，利用我们景区提供的快应用与工作人员取得联系之后，工作人员将与消防人员取得联系，帮助您脱困','2020-03-25','05:29:00',36,'huancui_Building'),(14,'question_014','monitor','景区内的监控会不会侵犯到我的隐私','我们景区承诺所有的监控录像...','我们景区承诺所有的监控录像均用于正常合法的工作用途，所以请游客不必担心个人的隐私安全问题','2020-03-25','06:29:00',38,'huancui_JiMuTing'),(15,'question_015','market','在超市被指控偷东西怎么办','一般情况下超市都会有监控...','一般情况下超市都会有监控录像，如果正好未被监控录像记录，这个时候可以请求我们的执法人员协助调查，我们将尽可能地保障游客在我们景区的人身利益','2020-03-25','07:29:00',40,'huancui_KongMiao'),(16,'question_016','way','路线导航错误怎么办','通常情况下路线导航不会出...','通常情况下路线导航不会出错误，如果出错，请将手机的GPS与WiFi全部打开，这样能够提高定位的精准度。','2020-03-25','08:29:00',42,'huancui_PenJing'),(17,'question_017','camping','露营的时候发现有人随意扔垃圾该怎么办','如果游客遇到别人随意倾倒…','如果游客遇到别人随意倾倒垃圾，可以及时制止的话请帮忙制止，特殊情况下可以直接联系我们景区的值班人员，我们将会对其做出我们该做的事情','2020-03-25','09:29:00',44,'huancui_Building'),(18,'question_018','cableway','索道在晚上会不会运行呢','2号索道线彻夜工作，但是1号与3号…','2号索道线彻夜工作，但是1号与3号索道将不会在晚上工作，因为晚上的天气不适合观景体验，2号索道在工作时有探照灯帮助游客观景','2020-03-25','10:29:00',46,'huancui_JiMuTing'),(19,'question_019','transfer','从盆景园到孔庙有没有推荐的换乘方案','建议游客搭乘35号线路，这样…','建议游客搭乘35号线路，这样的话可以在12分钟之内直接到达对应的地点','2020-03-25','11:29:00',48,'huancui_KongMiao'),(20,'question_020','ticket','门票可不可以在景区内当天进行购买','我们的景区游客服务中心处…','我们的景区游客服务中心处白天的工作时间是8点到晚上7点，期间游客可以直接在服务中心购买门票，其他时间段游客可以在我们的官方网战或公众号上进行门票的购买','2020-03-25','12:29:00',50,'huancui_PenJing'),(21,'question_021','safety','在景区内遭遇人身意外该怎么办','如果游客是由于个人原因导…','如果游客是由于个人原因导致的人身意外，景区将不会对此负责，但是若游客是因为景区设施老旧等问题遭遇意外，我们将会赔偿游客的所有损失','2020-03-25','13:29:00',52,'huancui_Building'),(22,'question_022','monitor','游客是否有权利观看景区的监控呢','对不起，我们景区暂未开放游…','对不起，我们景区暂未开放游客观看景区内监控的权限，为了仿制游客隐私遭到侵犯，我们后续也不打算提供此项服务','2020-03-25','14:29:00',54,'huancui_JiMuTing'),(23,'question_023','market','超市里买的纪念品价格比网上的贵了太多了可以反映吗','游客对于我们超市的物价有任…','游客对于我们超市的物价有任何的问题可以及时的联系我们景区工作人员，我们将会维护游客的合法权益，打压欺行霸市的现象','2020-03-25','15:29:00',56,'huancui_KongMiao'),(24,'question_024','way','快应用内推荐的导航路线是不是最短路线','一般来讲快应用内推荐的路线…','一般来讲快应用内推荐的路线是最优路线，有可能在距离上并不是最短的路线，我们所推荐的路线能够让游客获得最佳的游玩体验','2020-03-25','16:29:00',58,'huancui_PenJing');
