INSERT INTO `scenic_info` VALUES ('huancui_Building','环翠楼','环翠楼公园位于威海市区的中心地带，占地53.8公顷，是威海市区主要的园林风景区。它包括环翠楼公园和环翠楼广场两部分，因园内有古典式建筑“环翠楼”而得名。环翠楼始建于1489年，坐落在奈古山东麓，西负苍山，东眺碧海，南北分别与佛顶、古陌岭群峰相望。登楼可见“碧波浩淼于城东，绿翠掩映于四周，兼沧海山川之胜、水光山色之美”，遂以“环翠”名之。\n现环翠楼是2010年重新修建，建筑面积800平方米，主楼四层，高16.8米。登上环翠楼放眼远眺，威海市貌尽收眼底，在环翠楼观海上日出尤为游人所称道，“山楼初旭”是威海八景之一。园内有动物区、花卉区、游乐区等，各类服务设施齐全。','2012-11-21','08:17:19','环翠楼西侧环山，山内地形变化多端，为游客禁止入内区域，为了保障您和其他人的安全，请遵守景区安全细则，切勿因好奇跟风等心理进入西侧后山。','2013-12-28','20:22:58',120,4,4,'山东省威海市统一路120号环翠楼'),('huancui_JiMuTing','极目亭','极目亭同坐落在西城墙最高点的塔楼相互照应，西倚奈古山巅，东瞰苍茫大海，南望迤逦峰峦，北眺巍峨青山，置于一片翠绿之中，因而得名极目亭。由于当时的条件有限，使我们今天无法直观地看到早期极目亭的面貌。根据志书描写，那是一座做工非常精致的亭子，“画栋雕梁、金碧辉煌、飞檐斗拱、八窗洞达”。不过，清末民初的极目亭尚可通过照片略识概貌：极目亭稳坐于高筑的土台，楼顶呈四角帽状，脊线上翻、瓦檐飞翘，南北两侧封闭，但看不到洞达的八窗。时间的磨砺、风尘的侵袭使极目亭不断受到损害，顺治、康熙、乾隆年间曾对极目亭进行过维修和复建。此时的极目亭与初建时究竟有多大差别，现在已无从查考，可以肯定的是，重建后的极目亭已不复当年的金碧辉煌，倒是增添了十足的历史苍凉感。','2014-10-11','18:23:41','该景点暂无游客禁止进入的区域','2012-11-23','19:29:56',150,3,5,'山东省威海市统一路120号极目亭'),('huancui_KongMiao','孔庙','“孔庙又称文庙，历代王朝对孔子尊崇备至，从而把修庙祀孔作为国家大事来办，到了明、清时期，每一州、府、县治所所在都有文庙或孔庙。其数量之多、规制之高，建筑技术与艺术之精美，堪称中国古代建筑典范，是中国古代文化遗产中极其重要的组成部分。”孔祥林说，建孔庙，是对优秀传统文化的继承，教化人民。孔庙供奉孔子及儒家学说的历代圣贤，可激励人们奋发向上。威海自明设卫开始有儒学，此后被后人重新修建，对传统文化进行了很好的宣传和弘扬。','2018-10-29','21:11:28','该景点暂无游客禁止进入的区域','2018-10-30','19:47:12',400,4,4,'山东省威海市统一路120号孔庙'),('huancui_PenJing','盆景园','环翠楼-盆景园是一座集盆景与园林艺术为一体的多功能文化游乐园，为环翠楼公园的园中园。园内用仿古建筑和园林小品进行空间分割，形成众多小景观，与建筑、山水等巧妙配合，观感殊佳。','2017-10-12','14:28:31','该景点暂无游客禁止进入的区域','2017-10-12','14:28:31',200,5,5,'山东省威海市统一路120号盆景园'),('scenic','环翠楼公园','威海环翠楼公园于1992年5月由威海环翠区人民政府筹资兴建，位于威海市区，西负苍山，东眺碧海，南北分别与佛顶、古陌岭群峰相望，登楼可见碧波浩渺于城东，绿翠掩映于四周，遂以“环翠”名之。东广场建有民族英雄邓世昌的铜像，是威海著名的风景游览区，也是市民休憩、健身佳地。','2017-10-12','14:28:31','该景点暂无游客禁止进入的区域','2017-10-12','14:28:31',200,5,4,'山东省威海市统一路120号');
/*!40000 ALTER TABLE `scenic_info` ENABLE KEYS */;
UNLOCK TABLES;

