INSERT INTO `scenic_notice` VALUES (1,'notice_001','各旅行社及游客朋友们：第五届世界互联网大会将于下周在本市召开，为了保障景区以及大会的正常运转，避免给游客带来的不便，即日起景区将全面关闭，还请各位互相通告'),(2,'notice_002','为了实现景区“管理更简单，服务更满意，效益更出众”的目的，四川文化旅游开发有限公司将委托中道明华建设工程项目咨询有限责任公司对四川进行景区运营咨询，欢迎合格的选人前来参加比选'),(3,'notice_003','景区为老弱病残孕等行动不便人士提供绿色通道服务，如果有需要可以到游客中心办公室进行联系');
